const images = [
  { thumb: 'data:image/jpeg;base64,', full: 'data:image/jpeg;base64,', caption: 'Sunset' },
  { thumb: 'data:image/jpeg;base64,', full: 'data:image/jpeg;base64,', caption: 'Mountains' },
  { thumb: 'data:image/jpeg;base64,', full: 'data:image/jpeg;base64,', caption: 'Forest' },
  { thumb: 'data:image/jpeg;base64,', full: 'data:image/jpeg;base64,', caption: 'Ocean' }
];

const gallery = document.getElementById("gallery");
const lightbox = document.getElementById("lightbox");
const lightImg = document.getElementById("lightImg");
const caption = document.getElementById("caption");
const counter = document.getElementById("counter");
const closeBtn = document.getElementById("closeBtn");
const prevBtn = document.getElementById("prevBtn");
const nextBtn = document.getElementById("nextBtn");

let currentIndex = 0;

/* ---------- Create Thumbnails (Lazy Load) ---------- */
images.forEach((img, index) => {
  const image = document.createElement("img");
  image.src = img.thumb;
  image.loading = "lazy";           // Lazy loading
  image.dataset.index = index;
  gallery.appendChild(image);
});

/* ---------- Open Lightbox ---------- */
const openLightbox = (index) => {
  currentIndex = index;
  updateLightbox();
  lightbox.classList.add("active");
};

/* ---------- Close Lightbox ---------- */
const closeLightbox = () => {
  lightbox.classList.remove("active");
};

/* ---------- Update Content ---------- */
const updateLightbox = () => {
  const img = images[currentIndex];
  lightImg.src = img.full;
  caption.innerText = img.caption;
  counter.innerText = `${currentIndex + 1} of ${images.length}`;
};

/* ---------- Navigation ---------- */
const showNext = () => {
  currentIndex = (currentIndex + 1) % images.length;
  updateLightbox();
};

const showPrev = () => {
  currentIndex = (currentIndex - 1 + images.length) % images.length;
  updateLightbox();
};

/* ---------- Events ---------- */
gallery.addEventListener("click", (e) => {
  if (e.target.tagName === "IMG") {
    openLightbox(Number(e.target.dataset.index));
  }
});

closeBtn.addEventListener("click", closeLightbox);
nextBtn.addEventListener("click", showNext);
prevBtn.addEventListener("click", showPrev);

lightbox.addEventListener("click", (e) => {
  if (e.target === lightbox) closeLightbox();
});

/* ---------- Keyboard Navigation ---------- */
document.addEventListener("keydown", (e) => {
  if (!lightbox.classList.contains("active")) return;

  if (e.key === "ArrowRight") showNext();
  if (e.key === "ArrowLeft") showPrev();
  if (e.key === "Escape") closeLightbox();
});
